        private void AddUnidadSalud(string nombre, string clues, string clave, string municipio,
            string localidad,string tipoEstablecimiento,string direccion, string codigoPostal,
            string telefono, string horario, string accionesSaludPublica, string consultaMedicinaGeneralFamiliar,
            string odontologia,string anestesiologia,string cirugia, string ginecologiaObstetricia,
            string medicinaInterna, string pediatra, string traumaOrtopedia, string atencionUrgencias,
            string radiologia, string laboratorioClinico, string bancoSangre,string latitud,string longitud,
            string gestor,string unidad)
        {
            unidadesSalud.Add(new UnidadSalud
            {
                Nombre = nombre,
                Clues = clues,
                Clave = clave,
                Municipio = municipio,
                Localidad = localidad,
                TipoEstablecimiento = tipoEstablecimiento,
                Direccion = direccion,
                CodigoPostal = codigoPostal,
                Telefono = telefono,
                Horario = horario,
                AccionesSaludPublica = accionesSaludPublica,
                ConsultaMedicinaGeneralFamiliar = consultaMedicinaGeneralFamiliar,
                Odontologia = odontologia,
                Anestesiologia = anestesiologia,
                Cirugia = cirugia,
                GinecologiaObstetricia = ginecologiaObstetricia,
                MedicinaInterna = medicinaInterna,
                Pediatra = pediatra,
                TraumaOrtopedia = traumaOrtopedia,
                AtencionUrgencias = atencionUrgencias,
                Radiologia = radiologia,
                LaboratorioClinico = laboratorioClinico,
                BancoSangre = bancoSangre,
                Latitud = latitud,
                Longitud = longitud,
                Gestor = gestor,
                Unidad = unidad
            });
        }

