        private void AddCentrosAfiliacion(string nombre,string direccion,string telefono,
            string responsable,string telefonoResponsable,string horario,string correo,
            string latitud,string longitud)
        {
            centrosAfiliacion.Add(new CentroAfiliacion
            {
                Nombre = nombre,
                Direccion = direccion,
                Telefono = telefono,
                Responsable = responsable,
                TelefonoResponsable = telefonoResponsable,
                Horario = horario,
                Correo = correo,
                Latitud = latitud,
                Longitud = longitud
            });
        }

        public string GetUnidadSaludAsignada(string clues)
        {

            var unidad = from n in GetAllUnidadesSalud()
                         where n.Clues == clues
                         select n;

            string nombreUnidad = unidad.ElementAt(0).Nombre;

            return nombreUnidad;
        }

